About: For Johnny, Daryl and Moon, grad night is a time to bust out and party, and that's exactly what they do in Getting Lucky! Join the boys as they head out on the town for a night to remember, and get involved in some of the most outragous sexual encounters to ever sizzle the screen! Johnny makes a sporting wager with gorgeous hookers, whoever enjoys their love session the most has to pay! Daryl gets hooked up with a rich and beautiful older women, and learns a thing or two about the &quot;filthy rich.&quot; But it's Moon, the class dork, who takes the cake when he gets involved with three horny chicks out to make a man come ten times in one night!
